class Solution(object):
    def isCousins(self, root, x, y):
        """
        :type root: TreeNode
        :type x: int
        :type y: int
        :rtype: bool
        """
        def find(x):
            q=collections.deque()
            q.append((root, None, 0))
            while q:
                node, p, d = q.popleft()
                if node.val == x:
                    return p, d
                else:
                    if node.left is not None:
                        q.append((node.left, node, d+1))
                    if node.right is not None:
                        q.append((node.right, node, d+1))
        px, dx = find(x)
        py, dy = find(y)
        return dx == dy and px != py

